import { FaGithub, FaLinkedin } from "react-icons/fa";

function HomePage() {
	return (
		<>
			<header>
				<h1>Sean Lyons</h1>
				<ul>
					<li>
						<FaGithub />
					</li>
					<li>
						<FaLinkedin />
					</li>
				</ul>
			</header>

			<style jsx>{`
				@import url("https://fonts.googleapis.com/css?family=Abril+Fatface&display=swap");
			`}</style>
		</>
	);
}

export default HomePage;
